import React, { useState } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts';
import { Power, DollarSign, TrendingDown, X } from 'lucide-react';

// Sample data - replace with actual data in production
const generateSampleData = (days) => {
  return Array.from({ length: days }, (_, i) => ({
    name: `Day ${i + 1}`,
    consumption: Math.random() * 100 + 50,
    cost: (Math.random() * 100 + 50) * 0.12
  }));
};

const TimeRangeSelector = ({ timeRange, setTimeRange }) => (
  <div className="flex space-x-2 mb-4">
    {['day', 'week', 'month', 'year'].map((range) => (
      <button
        key={range}
        onClick={() => setTimeRange(range)}
        className={`px-4 py-2 rounded-lg transition-colors ${
          timeRange === range
            ? 'bg-blue-500 text-white'
            : 'bg-gray-100 hover:bg-gray-200'
        }`}
      >
        {range.charAt(0).toUpperCase() + range.slice(1)}
      </button>
    ))}
  </div>
);

const EnergyMetricCard = ({ icon: Icon, title, value, unit, color }) => (
  <div className="bg-white p-6 rounded-xl shadow-md">
    <div className="flex items-center gap-3 mb-2">
      <Icon className={`w-6 h-6 ${color}`} />
      <h3 className="text-gray-600 font-medium">{title}</h3>
    </div>
    <p className="text-3xl font-bold">
      {value}
      <span className="text-lg ml-1 text-gray-500">{unit}</span>
    </p>
  </div>
);

export const RoomEnergyCard = ({ room }) => {
  const [isOn, setIsOn] = useState(true);
  const [showDetails, setShowDetails] = useState(false);
  const [timeRange, setTimeRange] = useState('day');

  const data = generateSampleData(7);

  return (
    <div className="bg-white rounded-xl shadow-lg p-6">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-xl font-semibold">{room.name}</h2>
        <div className="flex items-center gap-4">
          <button
            onClick={() => setShowDetails(!showDetails)}
            className="text-blue-500 hover:text-blue-600"
          >
            {showDetails ? 'Hide Details' : 'Show Details'}
          </button>
          <button
            onClick={() => setIsOn(!isOn)}
            className={`px-4 py-2 rounded-lg ${
              isOn 
                ? 'bg-green-500 hover:bg-green-600' 
                : 'bg-red-500 hover:bg-red-600'
            } text-white transition-colors`}
          >
            {isOn ? 'On' : 'Off'}
          </button>
        </div>
      </div>

      {showDetails && (
        <div className="mt-4 space-y-6">
          <TimeRangeSelector timeRange={timeRange} setTimeRange={setTimeRange} />

          <div className="grid grid-cols-3 gap-4 mb-6">
            <EnergyMetricCard
              icon={Power}
              title="Consumption"
              value="245"
              unit="kWh"
              color="text-blue-500"
            />
            <EnergyMetricCard
              icon={DollarSign}
              title="Cost"
              value="29.40"
              unit="USD"
              color="text-green-500"
            />
            <EnergyMetricCard
              icon={TrendingDown}
              title="Savings"
              value="12"
              unit="%"
              color="text-purple-500"
            />
          </div>

          <div className="h-64">
            <LineChart width={600} height={250} data={data}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" />
              <YAxis yAxisId="left" />
              <YAxis yAxisId="right" orientation="right" />
              <Tooltip />
              <Legend />
              <Line
                yAxisId="left"
                type="monotone"
                dataKey="consumption"
                stroke="#2563eb"
                name="Consumption (kWh)"
              />
              <Line
                yAxisId="right"
                type="monotone"
                dataKey="cost"
                stroke="#16a34a"
                name="Cost ($)"
              />
            </LineChart>
          </div>
        </div>
      )}
    </div>
  );
};

export const HomeEnergyPopup = ({ onClose }) => {
  const [timeRange, setTimeRange] = useState('week');
  const [isOptimized, setIsOptimized] = useState(false);

  const data = generateSampleData(30);

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
      <div className="bg-white rounded-xl shadow-2xl p-8 w-[800px] max-h-[90vh] overflow-y-auto">
        <div className="flex justify-between items-center mb-6">
          <h2 className="text-2xl font-bold">Home Energy Analytics</h2>
          <button
            onClick={onClose}
            className="p-2 hover:bg-gray-100 rounded-full transition-colors"
          >
            <X className="w-6 h-6" />
          </button>
        </div>

        <div className="space-y-6">
          <TimeRangeSelector timeRange={timeRange} setTimeRange={setTimeRange} />

          <div className="grid grid-cols-3 gap-4">
            <EnergyMetricCard
              icon={Power}
              title="Total Consumption"
              value="1,245"
              unit="kWh"
              color="text-blue-500"
            />
            <EnergyMetricCard
              icon={DollarSign}
              title="Total Cost"
              value="149.40"
              unit="USD"
              color="text-green-500"
            />
            <EnergyMetricCard
              icon={TrendingDown}
              title="Potential Savings"
              value="18"
              unit="%"
              color="text-purple-500"
            />
          </div>

          <div className="bg-gray-50 p-6 rounded-xl">
            <div className="flex justify-between items-center mb-4">
              <h3 className="text-lg font-semibold">Energy Optimization</h3>
              <button
                onClick={() => setIsOptimized(!isOptimized)}
                className={`px-6 py-2 rounded-lg ${
                  isOptimized 
                    ? 'bg-green-500 hover:bg-green-600' 
                    : 'bg-gray-500 hover:bg-gray-600'
                } text-white transition-colors`}
              >
                {isOptimized ? 'Optimized' : 'Optimize'}
              </button>
            </div>
            <p className="text-gray-600">
              {isOptimized 
                ? 'Your home is currently running in energy-saving mode. Estimated savings: 18%'
                : 'Enable home-wide energy optimization to reduce consumption.'}
            </p>
          </div>

          <div className="h-80">
            <LineChart width={700} height={300} data={data}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" />
              <YAxis yAxisId="left" />
              <YAxis yAxisId="right" orientation="right" />
              <Tooltip />
              <Legend />
              <Line
                yAxisId="left"
                type="monotone"
                dataKey="consumption"
                stroke="#2563eb"
                name="Consumption (kWh)"
              />
              <Line
                yAxisId="right"
                type="monotone"
                dataKey="cost"
                stroke="#16a34a"
                name="Cost ($)"
              />
            </LineChart>
          </div>
        </div>
      </div>
    </div>
  );
};

export default { RoomEnergyCard, HomeEnergyPopup };
